// MinimockFinish checks that all mocked methods have been called the expected number of times
func (m *MetricStorageMock) MinimockFinish() {
	m.finishOnce.Do(func() {
		if !m.minimockDone() {
			m.MinimockAddInspect()

			m.MinimockBulkAddInspect()

			m.MinimockGetInspect()

			m.MinimockListInspect()

			m.MinimockPingInspect()
			m.t.FailNow()
		}
	})
}

// MinimockWait waits for all mocked methods to be called the expected number of times
func (m *MetricStorageMock) MinimockWait(timeout mm_time.Duration) {
	timeoutCh := mm_time.After(timeout)
	for {
		if m.minimockDone() {
			return
		}
		select {
		case <-timeoutCh:
			m.MinimockFinish()
			return
		case <-mm_time.After(10 * mm_time.Millisecond):
		}
	}
}

func (m *MetricStorageMock) minimockDone() bool {
	done := true
	return done &&
		m.MinimockAddDone() &&
		m.MinimockBulkAddDone() &&
		m.MinimockGetDone() &&
		m.MinimockListDone() &&
		m.MinimockPingDone()
}
